/* eslint-disable react/no-unescaped-entities */
import React from 'react';
import { TopBar, Paper } from '@../../../../reactify/build';
import {
  simpleCode,
} from './code-refrence';
import './top-bar.scss';
import DemoCard from '../../components/demo-card';

const TopBarDemo = () => (
  <div>
    <DemoCard
      title="Simple Use"
      uniqueIdentifier="simpleUse"
      sourceCode={simpleCode}
    >
      <TopBar>
        <TopBar.Logo success>
          <label style={{ color: 'white', padding: '0.2em 0.4em', margin: 0 }} className="logo">reactify ui</label>
        </TopBar.Logo>
      </TopBar>
    </DemoCard>

  </div>
);

export default TopBarDemo;
